<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            background-color: #FFFFFF; /* Dark background color */
            margin: 0;
        }

        .arcade-cabinet {
            display: flex;
            flex-wrap: wrap;
            justify-content: space-around;
            gap: 20px;
            max-width: 800px;
        }

        .game {
            text-align: center;
            color: #000000; /* Black text color */
            text-decoration: none;
            transition: transform 0.3s ease-in-out;
        }

        .game:hover {
            transform: scale(1.1);
        }

        .game img {
            width: 150px;
            height: 150px;
            border-radius: 50%;
            overflow: hidden;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.3);
            transition: transform 0.3s ease-in-out;
        }

        .game:hover img {
            transform: scale(1.1);
        }
    </style>
